import React, { Component } from "react";
import "@popperjs/core";
import 'bootstrap/dist/css/bootstrap.min.css';
import ImageInputBox from './imageInputBox';
import Radio from './radio';
import RadioGroup from './radioGroup';

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <div>
                <table className="table table-success table-striped-columns" style={{width:"1050px",height:"331.25px"}}>
                    <thead>
                            <tr>
                            <th scope="col">반려동물 이름</th>
                            <th scope="col">달구</th>
                            <th scope="col">이름</th>
                            <th scope="col">김미소</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th scope="row">반려동물 종류</th>
                                <td>믹스견(장모종)</td>
                                <td>전화번호</td>
                                <td>010-xxxx-xxxx</td>
                            </tr>
                            <tr>
                                <th scope="row">반려동물 성별</th>
                                <td>여(중성화)</td>
                                <td>주소</td>
                                <td>부산광역시 동래구 000</td>
                            </tr>
                            <tr>
                                <th scope="row" rowSpan="3">요청사항(참고사진)</th>
                                <td colSpan="3">
                                    <tr>    <RadioGroup>
                                                <Radio name="contact" value="EMAIL" defaultChecked>
                                                이메일
                                                </Radio>
                                                <Radio name="contact" value="PHONE">
                                                전화
                                                </Radio>
                                                <Radio name="contact" value="FAX">
                                                팩스
                                                </Radio>
                                                <Radio name="contact" value="MAIL" disabled>
                                                우편
                                                </Radio>
                                            </RadioGroup>
                                    </tr>
                                    <tr>2</tr>
                                    <tr>3</tr>
                                    
                                </td>
                            </tr>
                        </tbody>
                </table>
            </div>

        )
    }
        
}


